import React, { useState } from 'react';

const initialMentees = [
  {
    name: 'Ariana Grande',
    since: 'June 2023',
    role: 'Product Design Associate',
    badge: 'Microsoft Teams',
    avatar: '',
  },
  {
    name: 'Alex Hamilton',
    since: 'May 2019',
    role: 'Product Marketing Intern',
    badge: 'Microsoft Teams',
    avatar: '',
  },
];

function Sidebar() {
  const [mentees, setMentees] = useState(initialMentees);
  const [newMentee, setNewMentee] = useState({ name: '', since: '', role: '', badge: '', avatar: '' });
  const [adding, setAdding] = useState(false);

  const handleAddMentee = () => {
    if (!newMentee.name || !newMentee.since || !newMentee.role) return;
    setMentees([...mentees, newMentee]);
    setNewMentee({ name: '', since: '', role: '', badge: '', avatar: '' });
    setAdding(false);
  };

  const handleRemoveMentee = (idx) => {
    setMentees(mentees.filter((_, i) => i !== idx));
  };

  return (
    <div className="sidebar">
      <div className="card">
        <div className="card-header">
          <h3 className="card-title">Your Mentees</h3>
          <button
            style={{ background: '#4a90e2', color: '#fff', border: 'none', borderRadius: 16, padding: '4px 14px', fontWeight: 500, fontSize: 14, cursor: 'pointer' }}
            onClick={() => setAdding(!adding)}
          >
            {adding ? 'Cancel' : 'Add'}
          </button>
        </div>
        {adding && (
          <div style={{ marginBottom: 16, marginTop: 8, display: 'flex', flexDirection: 'column', gap: 8 }}>
            <input
              type="text"
              placeholder="Name"
              value={newMentee.name}
              onChange={e => setNewMentee({ ...newMentee, name: e.target.value })}
              style={{ padding: 6, borderRadius: 4, border: '1px solid #ccc' }}
            />
            <input
              type="text"
              placeholder="Since (e.g. June 2023)"
              value={newMentee.since}
              onChange={e => setNewMentee({ ...newMentee, since: e.target.value })}
              style={{ padding: 6, borderRadius: 4, border: '1px solid #ccc' }}
            />
            <input
              type="text"
              placeholder="Role"
              value={newMentee.role}
              onChange={e => setNewMentee({ ...newMentee, role: e.target.value })}
              style={{ padding: 6, borderRadius: 4, border: '1px solid #ccc' }}
            />
            <input
              type="text"
              placeholder="Badge (optional)"
              value={newMentee.badge}
              onChange={e => setNewMentee({ ...newMentee, badge: e.target.value })}
              style={{ padding: 6, borderRadius: 4, border: '1px solid #ccc' }}
            />
            <button
              onClick={handleAddMentee}
              style={{ background: '#4a90e2', color: '#fff', border: 'none', borderRadius: 8, padding: '6px 16px', fontWeight: 500, fontSize: 15, marginTop: 4, cursor: 'pointer' }}
            >
              Add Mentee
            </button>
          </div>
        )}
        {mentees.map((mentee, idx) => (
          <div
            className="mentee-item"
            key={idx}
            style={{ cursor: 'pointer', border: '1px solid #e0e6ed', borderRadius: 12, marginBottom: 8, background: '#f9fbfd', boxShadow: '0 1px 4px rgba(74,144,226,0.04)' }}
            tabIndex={0}
            onClick={() => alert(`Viewing profile for ${mentee.name}`)}
          >
            <div className="mentee-avatar" style={{ background: '#ddd', width: 50, height: 50, borderRadius: '50%' }}></div>
            <div className="mentee-info">
              <h5>{mentee.name}</h5>
              <p>Since {mentee.since}</p>
              <p>{mentee.role}</p>
              {mentee.badge && <div className="mentee-badge">{mentee.badge}</div>}
              <button
                onClick={e => { e.stopPropagation(); handleRemoveMentee(idx); }}
                style={{ marginTop: 8, background: '#fff', color: '#e74c3c', border: '1px solid #e74c3c', borderRadius: 8, padding: '4px 10px', fontWeight: 500, fontSize: 13, cursor: 'pointer' }}
              >
                Remove
              </button>
            </div>
          </div>
        ))}
      </div>

      {/* Static mentee profile cards for mentor's view */}
      <div className="card">
        <div className="card-header">
          <h3 className="card-title">Mentee Profiles</h3>
        </div>
        {[0, 1].map(i => (
          <div
            key={i}
            className="mentee-item"
            style={{ border: '1px solid #e0e6ed', borderRadius: 12, marginBottom: 8, background: '#fff', boxShadow: '0 1px 4px rgba(74,144,226,0.04)', pointerEvents: 'none', opacity: 0.8 }}
          >
            <div className="mentee-avatar" style={{ background: '#ddd', width: 50, height: 50, borderRadius: '50%' }}></div>
            <div className="mentee-info">
              <h5>{mentees[i]?.name || 'Mentee Name'}</h5>
              <p>Since {mentees[i]?.since || 'Year'}</p>
              <p>{mentees[i]?.role || 'Role'}</p>
              {mentees[i]?.badge && <div className="mentee-badge">{mentees[i].badge}</div>}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Sidebar;
